import React from 'react';
import './Releases.css';



export default function Releases() {
  // Sample data for three movies
  const movies = [
    {
      title: 'Spy Kids',
      imageSrc: 'data:image/jpeg;base64,',
    },
    {
      title: 'Bottoms',
      imageSrc: 'data:image/jpeg;base64,',
    },
    {
      title: 'The Good Mother',
      imageSrc: 'data:image/jpeg;base64,',
    },
  ];

  return (
    <div className="releases">
      <hr />
      <h1>New Releases</h1>

      {/* Mapping through the movies array to create movie blocks */}
      <div className="movie-container">
        {movies.map((movie, index) => (
          <div key={index} className="movie-block">
            <img src={movie.imageSrc} alt={movie.title} />
            <h2>{movie.title}</h2>
            <button> Buy Tickets </button>
          </div>
        ))}
      </div>
    </div>
  );
}
